import './mm_content.css';
import PieChart from 'react-chartjs';

const chartData = [
  {
    value: 300,
    color:"#F7464A",
    highlight: "#FF5A5E",
    label: "Red"
  },
  {
    value: 50,
    color: "#46BFBD",
    highlight: "#5AD3D1",
    label: "Green"
  },
  {
    value: 100,
    color: "#FDB45C",
    highlight: "#FFC870",
    label: "Yellow"
  }
]

class Content extends Component {


  render() {
    return (
      <div className="_content">
        <div className="_content_title">
            <h2>Financial Analysis</h2>
            <p>23:14, Thursday, Jan 26, 2019</p>
        </div>
        <Graph_spending/>
        <PieChart data={chartData} options={chartOptions} width="600" height="250"/>
      </div>
    );
  }
}

class Graph_spending extends Component {
    render(){
        return(
            <div>this is a graph</div>
        )
    }
}

class Pie_spending extends Component {
    render(){
        return(
            <div>this is a pie chart</div>
        )
    }
}

export default Content;
